problem:
The parabola $y = ax^2 + bx + c$ crosses the $x$-axis at $(p,0)$ and $(q,0),$ both to the right of the origin.  A circle also passes through these two points.  Let $t$ be the length of the tangent from the origin to the circle.  Express $t^2$ in terms of one or more of the coefficients $a,$ $b,$ and $c.$

[asy]
unitsize(3 cm);

pair A, O, T;

real func (real x) {
  return ((x - 1)*(x - 2));
}

A = (1.5,-0.4);
O = (0,0);
T = intersectionpoint(Circle(A,abs(A - (1,0))),arc(A/2,abs(A)/2,0,90));

draw(graph(func,0.5,2.5));
draw((-0.5,0)--(2.5,0));
draw((0,-1)--(0,1));
draw(Circle(A,abs(A - (1,0))));
draw(O--T);

label("$t$", T/3, N);

dot(T);
[/asy]

The lateral surface area of the frustum of a solid right cone is the product of one-half the slant height ($L$) and the sum of the circumferences of the two circular faces. What is the number of square centimeters in the total surface area of the frustum shown here? Express your answer in terms of $\pi$.

[asy]
draw( scale(1,.2)*arc(origin,10,180,360) ) ;
draw( scale(1,.2)*arc(origin,10,15,165) , dashed ) ; //yes, there is a gap
draw( (-10,0)--(10,0) , dotted ) ;
label("20cm",(0,0),S);
draw((0,0)--(0,8));
label("8cm",(0,4),E);
draw( shift(0,8)*scale(1,.2)*circle(origin,4) ) ;
draw( (-4,8)--(4,8) , dotted ) ;
label("8cm",(0,8),N);
draw((-10,0)--(-4,8));
draw((10,0)--(4,8));
label("$L$",(5,4),NE);
[/asy]

There is an unlimited supply of congruent equilateral triangles made of colored paper.  Each triangle is a solid color with the same color on both sides of the paper. A large equilateral triangle is constructed from four of these paper triangles as shown.  Two large triangles are considered distinguishable if it is not possible to place one on the other, using translations, rotations, and/or reflections, so that their corresponding small triangles are of the same color. Given that there are six different colors of triangles from which to choose, how many distinguishable large equilateral triangles can be constructed?

[asy]
draw((0,0)--(10,0)--(5,8.7)--cycle);
draw((5,0)--(2.5,4.3)--(7.5,4.3)--cycle);
[/asy]

Calculate the value of \( \frac{A}{B} \) where:
\[
\begin{array}{l}
A=\frac{1}{1 \times 2}+\frac{1}{3 \times 4}+\cdots+\frac{1}{2003 \times 2004} \\
B=\frac{1}{1003 \times 2004}+\frac{1}{1004 \times 2003}+\cdots+\frac{1}{2004 \times 1003}
\end{array}
\]

What is the area, in square units, of triangle $ABC$? [asy]
unitsize(0.15inch);
path X = (-6.5, 0)--(5.5, 0);
path Y = (0, -3.5)--(0, 7.5);
draw(X); draw(Y);

for(int n=-6; n <= 5; ++n)
if( n != 0 )
draw( (n,0.25)--(n,-0.25) );
for(int n=-3; n <= 7; ++n)
if( n != 0 )
draw( (0.25,n)--(-0.25,n) );

pair A = (-4,3); pair B = (0,6); pair C = (2,-2);
dot(A); dot(B); dot(C);
label("$A\ (-4,3)$", A, NW); label("$B\ (0,6)$", B, NE); label("$C\ (2,-2)$", C, SE);
draw(A--B--C--cycle);
[/asy]

Isosceles triangle $ABE$ of area 100 square inches is cut by $\overline{CD}$ into an isosceles trapezoid and a smaller isosceles triangle. The area of the trapezoid is 75 square inches. If the altitude of triangle $ABE$ from $A$ is 20 inches, what is the number of inches in the length of $\overline{CD}$?

[asy]
draw((-9,0)--(0,24)--(9,0)--cycle);
draw((-6,8)--(6,8));
label("$A$",(0,24),N);
label("$B$",(-9,0),W);
label("$C$",(-6,8),NW);
label("$D$",(6,8),NE);
label("$E$",(9,0),E);
[/asy]

Semicircles of diameter 2'' are lined up as shown. What is the area, in square inches, of the shaded region in a 1-foot length of this pattern? Express your answer in terms of $\pi$.

[asy]import graph;
size(101);

path tophalf = Arc((0,0),1,180,0) -- Arc((2,0),1,180,0) -- Arc((4,0),1,180,0) -- Arc((6,0),1,180,0) -- Arc((8,0),1,180,90);
path bottomhalf = Arc((7,0),1,360,180) -- Arc((5,0),1,360,180) -- Arc((3,0),1,360,180) -- Arc((1,0),1,360,180) -- Arc((-1,0),1,360,270);
fill(tophalf--bottomhalf--cycle,gray(.6));
draw(tophalf,linewidth(1.5)); draw(bottomhalf,linewidth(1));
draw("$1'$",(-3,1.5)--(10,1.5),N,linewidth(1.5),Arrows(4));
draw((-3,1.25)--(-3,1.75),linewidth(1.5)); draw((10,1.25)--(10,1.75),linewidth(1.5));
dot((-5/3,0),linewidth(3)); dot((-7/3,0),linewidth(3)); dot((-3,0),linewidth(3));
dot((26/3,0),linewidth(3)); dot((28/3,0),linewidth(3)); dot((10,0),linewidth(3));[/asy]

This graph shows the linear relationship between the time in seconds, $x$, for Caroline's walk and the distance in meters, $y$, Caroline is from her starting point. The graph passes through the point $(20,30)$. According to the graph, how many meters will Caroline walk in exactly one hour? [asy]

pair A,B,C,D,E,F,G;

A=(-20,0);
B=(120,0);
C=(0,-20);
D=(0,120);
E=(-6.2,-8);
F=(60,90);
G=(70,105);

dot(F);

draw(A--B,Arrows);
draw(C--D,Arrows);
draw(E--G,Arrows);

label("(20,30)",G,SE);
label("$y=1.5x$",G,N);
[/asy]

Squares $ABCD$ and $EFGH$ are equal in area.  Vertices $B$, $E$, $C$, and $H$ lie on the same line.  Diagonal $AC$ is extended to $J$, the midpoint of $GH$.  What is the fraction of the two squares that is shaded? [asy]
fill((0,4)--(4,4)--(4,0)--cycle,gray);
fill((4,0)--(6,0)--(6,-2)--cycle,gray);
draw((0,0)--(4,0)--(4,4)--(0,4)--cycle,linewidth(1));
draw((2,0)--(6,0)--(6,-4)--(2,-4)--cycle,linewidth(1));
draw((0,4)--(6,-2),linewidth(1));
label("$A$",(0,4),NW);
label("$B$",(0,0),W);
label("$C$",(4,0),NE);
label("$D$",(4,4),NE);
label("$E$",(2,0),SW);
label("$F$",(2,-4),SW);
label("$G$",(6,-4),SE);
label("$H$",(6,0),E);
label("$J$",(6,-2),E);
[/asy]

Quadrilateral $ABCD$ is a square. A circle with center $D$ has arc $AEC$. A circle with center $B$ has arc $AFC$. If $AB = 2$ cm, what is the total number of square centimeters in the football-shaped area of regions II and III combined? Express your answer as a decimal to the nearest tenth.

[asy]
path a=(7,13)..(0,0)--(20,20)..cycle;
path b=(13,7)..(0,0)--(20,20)..cycle;
draw(a);
draw(b);
dot((8.6,3.5));
label("F",(8.6,3.5),SE);
label("E",(11.4,16.5),NW);
dot((11.4,16.5));
draw((0,0)--(20,0)--(20,20)--(0,20)--cycle);
label("$A$",(0,0),SW);
label("$B$",(0,20),NW);
label("$C$",(20,20),NE);
label("$D$",(20,0),SE);
label("I",(2,19),S);
label("II",(9,13),S);
label("III",(11,7),N);
label("IV",(18,1),N);
[/asy]

Suppose that there are two congruent triangles $\triangle ABC$ and $\triangle ACD$ such that $AB = AC = AD,$ as shown in the following diagram. If $\angle BAC = 20^\circ,$ then what is $\angle BDC$? [asy]
pair pA, pB, pC, pD;
pA = (0, 0);
pB = pA + dir(240);
pC = pA + dir(260);
pD = pA + dir(280);
draw(pA--pB--pC--pA);
draw(pA--pC--pD--pA);
label("$A$", pA, N);
label("$B$", pB, SW);
label("$C$", pC, S);
label("$D$", pD, E);
[/asy]

A European train compartment has six seats.  Four of the seats are broken.  Wilhelm needs to fill out a form like the one here to indicate that there are broken seats.  If he randomly checks off four of the seats in the diagram, what is the probability that he marked the correct seats?  Express your answer as a common fraction.

[asy]

draw((0,0)--(24,0)--(24,18)--(0,18)--(0,0));

label("$\textbf{Maintenance Report}$",(12,16));

draw((2,2)--(22,2)--(22,14)--(2,14)--(2,2));

draw((4,4)--(8,4)--(8,6)--(4,6)--(4,4));

draw((10,4)--(14,4)--(14,6)--(10,6)--(10,4));
label("$\surd$",(12,5));

draw((16,4)--(20,4)--(20,6)--(16,6)--(16,4));
label("$\surd$",(18,5));

draw((4,10)--(8,10)--(8,12)--(4,12)--(4,10));
label("$\surd$",(6,11));

draw((10,10)--(14,10)--(14,12)--(10,12)--(10,10));
label("$\surd$",(12,11));

draw((16,10)--(20,10)--(20,12)--(16,12)--(16,10));

[/asy]

What is the volume of a pyramid whose base is one face of a cube of side length $2$, and whose apex is the center of the cube? Give your answer in simplest form.

[asy]
import three;
triple A,B,C,D,EE,F,G,H;
A = (0,0,0);
B = (1,0,0);
C = (1,1,0);
D= (0,1,0);
EE = (0,0,1);
F = B+EE;
G = C + EE;
H = D + EE;
O = G/2;
draw(surface(B--O--C--cycle),red,nolight);
draw(surface(C--O--D--cycle),red+white,nolight);
draw(B--C--D);
draw(B--A--D,dashed);
draw(EE--F--G--H--EE);
draw(A--EE,dashed);
draw(B--F);
draw(C--G);
draw(D--H);
draw(A--O--C,dashed);
draw(B--O--D,dashed);
dot(A); dot(B); dot(C); dot(D); dot(EE); dot(F); dot(G); dot(H); dot(O);
[/asy]

In the figure below, $ABDC,$ $EFHG,$ and $ASHY$ are all squares; $AB=EF =1$ and $AY=5$.

What is the area of quadrilateral $DYES$?

[asy]
size(5cm);
defaultpen(black+1);
pair a=(0,5); pair b=(1,5); pair c=(0,4); pair d=(1,4); pair e=(4,1); pair f=(5,1); pair g=(4,0); pair h=(5,0); pair y=(0,0); pair s=(5,5);
draw(a--s--h--y--a);
draw(c--d--b,gray);
draw(g--e--f,gray);
draw(d--y--e--s--d);
dot(a); dot(b); dot(c); dot(d); dot(e); dot(f); dot(g); dot(h); dot(y); dot(s);
label("$A$",a,NW);
label("$B$",b,N);
label("$C$",c,W);
label("$D$",d,SE);
label("$E$",e,NW);
label("$F$",f,E);
label("$G$",g,S);
label("$H$",h,SE);
label("$Y$",y,SW);
label("$S$",s,NE);
[/asy]

A system consists of 7 components with independent, identically distributed lifetimes. The system will operate until any one of the components fails. If the lifetime \( X \) of each component has the probability density function:
\[
f(x) =
\begin{cases}
\frac{3}{x^4},  & \text{for } x > 1 \\
0, & \text{otherwise}
\end{cases}
\]
what is the expected lifetime until failure of the system?

Determine the sup-norm, \(\|f\|_{\sup}\), for the function \(f(x)\) defined as:

\[f(x)=\begin{cases} 
0, & x \in \mathbb{Q} \\
-x^2, & x \not\in \mathbb{Q}
\end{cases}\]

Solve the system of non-linear differential equations given by:
\[
\begin{array}{rcl}
\displaystyle \frac{dx}{dt}&=&y^{2} \\
\displaystyle \frac{dy}{dt}&=&x^{2}
\end{array}
\]
